
<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="utf-8">
<meta name="viewport" content="width=device-width, initial-scale=1, viewport-fit=cover" />
<title>Ciphered Circuit — Stage 1 Radio</title>
<meta name="theme-color" content="#0a0f14">
<meta name="mobile-web-app-capable" content="yes">
<meta name="apple-mobile-web-app-capable" content="yes">
<meta name="apple-mobile-web-app-status-bar-style" content="black-translucent">
<style>
  :root{--bg:#0a0f14; --primary:#20ffe3; --accent:#ff5d73; --muted:#7bd4c9; --glass:rgba(255,255,255,0.06);}
  html,body{margin:0;padding:0;background:var(--bg);color:#e8fff9;font-family:ui-sans-serif,system-ui,-apple-system,Segoe UI,Roboto,Helvetica,Arial;height:100%;width:100%;}
  .container{display:flex;flex-direction:column;align-items:center;justify-content:center;width:100%;height:100%;padding:8px;}
  .radio{width:100%;max-width:520px;background:linear-gradient(145deg,#0d1218,#06090f);border:1px solid rgba(32,255,227,0.2);border-radius:18px;box-shadow:0 10px 30px rgba(0,0,0,0.6),inset 0 0 30px rgba(32,255,227,0.05);overflow:hidden;position:relative;}
  .scanlines:before{content:"";position:absolute;inset:0;background:repeating-linear-gradient(to bottom,rgba(0,0,0,0.15) 0,rgba(0,0,0,0.15) 2px,transparent 2px,transparent 4px);mix-blend-mode:overlay;pointer-events:none;}
  .bezel{padding:14px;}
  .header{display:flex;align-items:center;justify-content:space-between;margin-bottom:8px;}
  .badge{letter-spacing:.1em;font-weight:700;color:var(--primary);font-size:.9rem;text-shadow:0 0 6px rgba(32,255,227,0.6);}
  .tiny-led{width:8px;height:8px;border-radius:50%;background:#032c28;border:1px solid #1bf1d6;box-shadow:0 0 10px rgba(27,241,214,0.25) inset;}
  .screen{background:radial-gradient(110% 90% at 50% 10%,#0c2832 0%,#071a21 60%,#041014 100%);border:1px solid rgba(32,255,227,0.2);border-radius:14px;padding:12px;min-height:220px;position:relative;overflow:hidden;}
  .dial{height:5px;background:linear-gradient(90deg,rgba(32,255,227,0.2),rgba(32,255,227,0.8),rgba(32,255,227,0.2));border-radius:5px;margin:10px 0 8px;opacity:.85;position:relative;}
  .needle{position:absolute;top:-7px;width:2px;height:18px;background:var(--accent);box-shadow:0 0 10px rgba(255,93,115,0.65);transform:translateX(0);transition:transform 1.8s cubic-bezier(.19,1,.22,1);}
  .tune-readout{display:flex;justify-content:space-between;font-family:ui-monospace,SFMono-Regular,Menlo,Consolas,monospace;font-size:.78rem;color:var(--muted);opacity:.9;}
  .big{font-family:ui-monospace,SFMono-Regular,Menlo,Consolas,monospace;font-size:clamp(1rem,4.8vw,1.35rem);text-align:center;text-shadow:0 0 10px rgba(32,255,227,0.55);}
  .controls{display:flex;flex-wrap:wrap;gap:8px;justify-content:center;margin-top:12px;}
  button{border:1px solid rgba(32,255,227,0.4);background:linear-gradient(160deg,rgba(32,255,227,0.15),rgba(32,255,227,0.04));color:#bafff3;padding:9px 13px;border-radius:999px;font-size:.95rem;font-weight:600;cursor:pointer;}
  .status{font-size:.78rem;text-align:center;color:var(--muted);margin-top:6px;}
  .footer{font-size:.78rem;color:var(--muted);display:flex;justify-content:space-between;margin-top:8px;}
  canvas#snow{position:absolute;inset:0;opacity:.2;pointer-events:none;}
  @media (orientation:landscape){
    .container{padding:12px;}
    .radio{max-width:900px;display:grid;grid-template-columns:1fr 320px;gap:12px;}
    .bezel{padding:18px;}
    .screen{min-height:260px;}
    .controls{flex-direction:column;align-items:stretch;gap:10px;margin-top:0;}
    .footer{grid-column:1 / -1;}
  }
</style>
</head>

<script>
// --- Static snow fix (fills entire .screen, DPR-aware) ---
const canvas=document.getElementById('snow'); const ctx=canvas.getContext('2d');
function sizeCanvas(){ const rect=canvas.getBoundingClientRect(); const dpr=Math.max(1,Math.floor(window.devicePixelRatio||1)); canvas.width=Math.round(rect.width*dpr); canvas.height=Math.round(rect.height*dpr); }
function drawSnow(){ const w=canvas.width,h=canvas.height; if(!w||!h)return; const img=ctx.createImageData(w,h); const data=img.data; for(let i=0;i<data.length;i+=4){ const v=Math.random()*255; data[i]=data[i+1]=data[i+2]=v; data[i+3]=255; } ctx.putImageData(img,0,0); }
function resizeAll(){ sizeCanvas(); drawSnow(); }
const ro=new ResizeObserver(resizeAll); ro.observe(canvas.parentElement); addEventListener('resize',resizeAll); resizeAll(); let snowTimer=setInterval(drawSnow,60);

// --- Main radio behavior ---
const needle=document.getElementById('needle'),readout=document.getElementById('readout'),statusEl=document.getElementById('status'),led=document.getElementById('led'),playBtn=document.getElementById('playBtn'),replayBtn=document.getElementById('replayBtn'),revealBtn=document.getElementById('revealBtn'),audio=document.getElementById('morseAudio');
const clearText="N40 44.123 W074 00.789",TUNING_MS=2200;
async function requestFullscreen(){try{const el=document.documentElement;if(el.requestFullscreen){await el.requestFullscreen();}else if(el.webkitRequestFullscreen){el.webkitRequestFullscreen();}}catch(e){}}
function setNeedle(p){const w=document.querySelector('.dial').clientWidth;const x=Math.max(0,Math.min(w-2,p*(w-2)));needle.style.transform=`translateX(${x}px)`;}
function animateTune(){setNeedle(0.05);setTimeout(()=>setNeedle(0.35),300);setTimeout(()=>setNeedle(0.62),700);setTimeout(()=>setNeedle(0.88),1200);setTimeout(()=>setNeedle(0.67),1500);}
function playSequence(){playBtn.disabled=true;statusEl.textContent="Tuning…";led.style.background="#22ffdd";animateTune();readout.textContent="— Searching bands —";
setTimeout(()=>{readout.textContent="— Signal lock —";statusEl.textContent="Receiving Morse…";audio.currentTime=0;audio.play().then(()=>{
audio.onended=()=>{statusEl.textContent="Transmission lost.";replayBtn.disabled=false;playBtn.disabled=false;led.style.background="#032c28";};
}).catch(()=>{statusEl.textContent="Audio blocked, tap again.";playBtn.disabled=false;led.style.background="#ff5d73";});},TUNING_MS+500);}
playBtn.addEventListener('click', async ()=>{await requestFullscreen();playSequence();});
replayBtn.addEventListener('click',()=>{audio.currentTime=0;audio.play();statusEl.textContent="Replaying…";});
revealBtn.addEventListener('click',()=>{if(readout.textContent===clearText){readout.textContent="— Standby —";revealBtn.textContent="Reveal Text";}else{readout.textContent=clearText;revealBtn.textContent="Hide Text";}});
</script>
